// imports react
import React from 'react';
// imports profile picture
import joeys from '../assets/images/joey.jpg'




// aboutme function
function AboutMe() {

  // returns html for aboutme state
  return (


    <div>
        <img id="photo" src={joeys} alt="Joey Douek" height="250" width="250" className="rounded-circle border border-2 border-white"></img>

      <div className='d-flex flex-column align-items-center pb-5'>
      <p className='w-25'>
      Hi, My name is Joey. Computers and sound has been a craft of mine for quite sometime. Previous work experiences have been in IT hardware troubleshooting and retail selling. My career path will be moving towards coding development.

      </p>
      </div>
    </div>

  );
};
// exports aboutme function
export default AboutMe;
